import { useEffect, useState } from 'react';
import axios from "./api/axios"
import './App.css';

function App() {
  const [posts, setPosts] = useState([])

  useEffect(() => {
    axios.get("/posts?_limit=5").then((res) => {
      setPosts(res.data)
    })
  }, [])

  return (
    <div className="App">
      <h1>게시글 목록</h1>
      <ul>
        {posts.map((post) => (
          <li key={post.id}>{post.title}</li>
        ))}
      </ul>
    </div>
  );
}

export default App;
